import "./ExpenseDate.css";

function ExpenseDate(props) {
  const years = props.date.getFullYear();
  const months = props.date.toLocaleString("ko-KR", { month: "long" });
  const days = props.date.toLocaleString("ko-KR", { day: "2-digit" });

  return (
    <div>
      <div className='expense-date__years'>{years}</div>
      <div className='expense-date__months'>{months}</div>
      <div className='expense-date'>{days}</div>
    </div>
  );
}

export default ExpenseDate;

